export default class BackToTop extends React.Component {
  
  constructor(){
    super();
    var T = null;
    this.state = {
      date:null
    }
  }
  
  //   处理文本数据和html数据
  componentDidMount(){
    fetch('http://localhost:8080/React_Manage2/myaction.action',{
      method: 'POST', 
	    mode: 'cors', 
    })
    .then((response)=> {
      return response.text();
    }).then((text)=> { 
      this.setState({
        date: text
      });
      document.getElementById("s_t").innerHTML=text;
    })    
  }



  render(){
    const Vv = this.state.date&&Object.keys(this.state.date)
    return (
      <div>
        <h3 id="s_t"></h3>
        hello
        <br/>
        {this.state.date}
        
        <br/>
        {Vv && Vv.map((t)=>(
          this.state.date[t].code
          ,
          this.state.date[t].name
        ))}
      </div>
    
    )
  }
  ;
}
